import React from "react";

function Test({ movie }){
    return (
        <div>
            <p>{movie.title}Bonjour</p>
            <p>{movie.director}</p>
            <p>{movie.country}</p>
            <img src={movie.posterUrl} alt={movie.title}/>
        </div>
    )
}

export default Test;
